import React from "react";
import "../styles/RequestsPage.css";

const RequestsPage = () => {
  return (
    <div className="requests-page">
      <h2>Requests Management</h2>
      <p>Here you can manage user requests.</p>
    </div>
  );
};

export default RequestsPage;
